import { Link } from "react-router-dom";
import classes from "./UserMainPage.module.css";

const UserMainPage = () => {
  var text = 9;
  return (
    <div className="main">
      <p className="title">Vaš Parking</p>

      <h4>1 SAT</h4>
      <div className={[classes.options + " options "]}>
        <Link to={"sms:+387833510;?&body=" + text}>ZONA 0</Link>
        <Link to={"sms:+387833511;?&body=" + text}>ZONA 1</Link>
        <Link to={"sms:+387833512;?&body=" + text}>ZONA 2</Link>
        <Link to={"sms:+387833512;?&body=" + text}>ZONA 2</Link>
        <Link to={"sms:+387833512;?&body=" + text}>ZONA 2</Link>
        <Link className={classes.locations} to="/locations-list">
          Spisak lokacija
        </Link>
        <Link className={classes.locations} to="/locations-list">
          Mapa lokacija
        </Link>
        <h4>Plaćeno: 32,50KM</h4>
        <Link to={"sms:+387833512;?&body=" + text}>Pregled plaćanja</Link>
      </div>
    </div>
  );
};

export default UserMainPage;
